description:
Plot

Stripped of her license when a patient dies, Dr. Alice Dodgson (Jennifer Grey) moves to Jamaica and accepts a job ministering to a man (Daniel Lapaine) suffering from encephalitis and claiming to be hexed by voodoo curse. As Alice is drawn into the world of the supernatural, she finds her staunch belief in science put to the test -- and her life put in danger. Craig Sheffer, Tim Curry and Kristen Wilson round out the cast in this eerie chiller.



